import logo from './logo.svg';
import './App.css';
import React, { Component } from 'react';

class App extends React.Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
        <form>
          <label>
            link:
            <input type="text" name="name" />
          </label>
          <input type="submit" value="Submit" />
        </form>
        </header>
      </div>
    );
  }

}

export default App;
